.manager {
  .note {
    .note-wrapper {
      border: 1px solid #e8e8e8;
      border-radius: 4px;
      padding: 15px;
      margin-top: 15px;
      display: flex;
    }
    .main-content {
      width: 40%;

      .title-content {
        display: block;
        margin-bottom: 10px;
        font-weight: 600;
        font-size: 20px;
      }

      .content {
        display: block;
        font-size: 1.1em;
        margin: 7px;
        .title {
          font-size: 1em;
          padding-right: 13px;
          display: inline;
          font-weight: 600;
          color: #00adff;
        }
      }
    }

    .content-number {
      width: 60%;
      padding-left: 10px;
      border-left: 1px solid #cecece;

      .content {
        display: block;
      }
    }
  }
  .el-dialog {
    width: 90%;
  }

  .add {
    .el-dialog {
      width: 50%;
    }
  }

  .edit {
    .el-dialog {
      width: 50%;
    }
  }
  .link-type, .link-type:focus {
    color: #337ab7;
    cursor: pointer;
  }
  .header-container {
    div {
      padding-bottom: 24px;

    }
  }
  .el-table th {
    background: #f5f5f5;
  }
  .el-table {
    width:auto ;
  }
  .el-table tr {
    .show {
      background: #ccc;
      cursor: not-allowed;
    }

  }
  .text-success {
    background-color: #fff;
    border-color: #d0f5e0;
    color: #13ce66;
  }
  .text-danger {
    background-color: #fff;
    border-color: #e9e9eb;
    color: red;
  }
  .el-table .warning-row {
    background: #C0C0C0;
    cursor: not-allowed;
  }
}

.manager-radio {
  .list-radio__main--lever-header{
    width: 68px;
  }

  .list-radio__main--lever-item {
    width: 68px;
  }

  .list-radio__main--lever-wrapper {
    padding-left: 100px
  }

  .list-radio .list-subject-content_name {
    width: 100px;
  }

  &-container {
    margin: 30px;
  }

  &-item-select {
    text-transform: capitalize;
  }

  &-header {
    display: flex;

    .button {
      margin-left: 20px;
      display: inherit;
    }

    .el-input__inner {
      text-transform: capitalize;
    }
  }

  &_content {
    box-shadow: 1px 0px 4px 1px #e4e4e4;
    border: 1px solid #e8e8e8;
    padding: 20px;
    margin-top: 20px;

    &-footer {
      margin-top: 20px;

      &-item {
        display: flex;
        margin-top: 20px;

        .title-item {
          width: 340px;
          display: inline-block;
        }

        .el-textarea {
          width: 400px;
        }
      }
    }
  }
  .reUseButton {
    margin-left: 10px;
  }

  .title {
    color: #00adff;
    text-transform: uppercase;
    font-weight: 600;
  }
  .title-warning {
    color: red;
    text-transform: uppercase;
    font-weight: 500;
    width: 800px;
    display: inline-block;
    padding-top: 20px;
  }



  &_wrap {
    display: flex;
    margin-top: 20px;
  }

  &-text {
    font-size: 30px;
    line-height: 46px;
  }

  &_time {
    width: 50%;

    .list-radio {
      margin-top: 10px;
    }
  }

  &_subject {
    margin-right: 10px;
    width: 50%;

    .list-radio {
      margin-top: 10px;
    }
  }
}

.pagination-container {
  background: #fff;
  padding: 23px 0px;
}
.pagination-container.hidden {
  display: none;
}
